¿Quién soy? Hola, aquí vas a leer un poco sobre mi 🤩
 Físico matemático, estudiante eterno y amante de las ciencias Tengo un don para elegir el peor momento y lo aprovecho Si me definiera en una frase sería &ldquo;primero me emociono, luego pienso&rdquo;
 Definitivamente no puedo hablar de mi sin mencionar a Mila y Meri, ellas son mis dos perrijas, se supone que son de raza pug, pero la neta las adoptamos, no las compramos y las adoptamos porque su mamá ya no las quería ni las podía tener.
